using ObjectCalisthenics;
using Xunit;

namespace UnitTests
{
    public class UnitTests
    {
        [Fact]
        public void TestNegativeMax()
        {
            TestConvert(int.MinValue, string.Empty);
        }

        [Fact]
        public void TestNegative1()
        {
            TestConvert(-1, string.Empty);
        }

        [Fact]
        public void Test0()
        {
            TestConvert(0, string.Empty);
        }

        [Fact]
        public void Test1()
        {
            TestConvert(1, "I");
        }

        [Fact]
        public void Test5()
        {
            TestConvert(5, "V");
        }

        [Fact]
        public void Test10()
        {
            TestConvert(10, "X");
        }

        [Fact]
        public void Test50()
        {
            TestConvert(50, "L");
        }

        [Fact]
        public void Test88()
        {
            TestConvert(88, "LXXXVIII");
        }

        [Fact]
        public void Test100()
        {
            TestConvert(100, "C");
        }

        [Fact]
        public void Test4999()
        {
            TestConvert(4999, "MMMMCMXCIX");
        }

        [Fact]
        public void Test65234()
        {
            TestConvert(65234, "MMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMMCCXXXIV");
        }

        [Fact]
        public void Test865234()
        {
            TestConvert(865234, "");
        }

        [Fact]
        public void Test5865234()
        {
            TestConvert(5865234, "");
        }

        [Fact]
        public void Test10000052()
        {
            TestConvert(10000052, "");
        }

        private void TestConvert(int arabic, string expectedResult)
        {
            string result = RomanNumerator.Convert(arabic);

            Assert.Equal(result, expectedResult);
        }
    }
}
